import { Header } from '../../Components/Header/Header.js';
import './Register.css';
import react from 'react';
import {Footer} from '../../Components/Footer/Footer.js';

function Register()
{
    return (
    <div className='RegisterContainer'>
      <Header/>
      <Footer/>
    </div>
    );
}

export default Register;
